import { Layout, Menu } from "antd";
import React from "react";
import 'antd/dist/antd.css';

function Header() {
const { Header, Content, Sider } = Layout;

  return (
    <Layout>
        <Header className="header">
            <div className="logo"><h2 className="logo-text">ANT-IT</h2></div>
            <Menu theme="dark" mode="horizontal" className="menu-item-list">
                <Menu.Item key="1" className="menu-item">HOME</Menu.Item>
                <Menu.Item key="2" className="menu-item">ABOUT US</Menu.Item>
                <Menu.Item key="3" className="menu-item">PORTFOLIO</Menu.Item>
                <Menu.Item key="3" className="menu-item">SERVICES</Menu.Item>
                <Menu.Item key="3" className="menu-item">CONTACT</Menu.Item>
            </Menu>
        </Header>
    </Layout>
  );
}
export default Header;
